create procedure [sp_MSupd_dboAccessRule]
		@c1 bigint = NULL,
		@c2 bigint = NULL,
		@c3 bigint = NULL,
		@c4 int = NULL,
		@c5 varchar(100) = NULL,
		@c6 datetime = NULL,
		@c7 varchar(100) = NULL,
		@c8 datetime = NULL,
		@c9 uniqueidentifier = NULL,
		@c10 bigint = NULL,
		@c11 nvarchar(max) = NULL,
		@c12 bit = NULL,
		@c13 bit = NULL,
		@c14 bit = NULL,
		@c15 bit = NULL,
		@c16 bit = NULL,
		@c17 bit = NULL,
		@c18 bit = NULL,
		@c19 bit = NULL,
		@c20 bigint = NULL,
		@c21 bit = NULL,
		@pkc1 bigint = NULL,
		@bitmap binary(3)
as
begin  
	declare @primarykey_text nvarchar(100) = ''
if (substring(@bitmap,1,1) & 1 = 1)
begin 

update [dbo].[AccessRule] set
		[AccessRuleID] = case substring(@bitmap,1,1) & 1 when 1 then @c1 else [AccessRuleID] end,
		[GrantingActorSiteGroupID] = case substring(@bitmap,1,1) & 2 when 2 then @c2 else [GrantingActorSiteGroupID] end,
		[GrantingActorSiteID] = case substring(@bitmap,1,1) & 4 when 4 then @c3 else [GrantingActorSiteID] end,
		[intRowStatus] = case substring(@bitmap,1,1) & 8 when 8 then @c4 else [intRowStatus] end,
		[AuditCreateUser] = case substring(@bitmap,1,1) & 16 when 16 then @c5 else [AuditCreateUser] end,
		[AuditCreateDTM] = case substring(@bitmap,1,1) & 32 when 32 then @c6 else [AuditCreateDTM] end,
		[AuditUpdateUser] = case substring(@bitmap,1,1) & 64 when 64 then @c7 else [AuditUpdateUser] end,
		[AuditUpdateDTM] = case substring(@bitmap,1,1) & 128 when 128 then @c8 else [AuditUpdateDTM] end,
		[rowguid] = case substring(@bitmap,2,1) & 1 when 1 then @c9 else [rowguid] end,
		[SourceSystemNameID] = case substring(@bitmap,2,1) & 2 when 2 then @c10 else [SourceSystemNameID] end,
		[SourceSystemKeyValue] = case substring(@bitmap,2,1) & 4 when 4 then @c11 else [SourceSystemKeyValue] end,
		[ReadPermissionIndicator] = case substring(@bitmap,2,1) & 8 when 8 then @c12 else [ReadPermissionIndicator] end,
		[AccessToPersonalDataPermissionIndicator] = case substring(@bitmap,2,1) & 16 when 16 then @c13 else [AccessToPersonalDataPermissionIndicator] end,
		[AccessToGenderAndAgeDataPermissionIndicator] = case substring(@bitmap,2,1) & 32 when 32 then @c14 else [AccessToGenderAndAgeDataPermissionIndicator] end,
		[WritePermissionIndicator] = case substring(@bitmap,2,1) & 64 when 64 then @c15 else [WritePermissionIndicator] end,
		[DeletePermissionIndicator] = case substring(@bitmap,2,1) & 128 when 128 then @c16 else [DeletePermissionIndicator] end,
		[BorderingAreaRuleIndicator] = case substring(@bitmap,3,1) & 1 when 1 then @c17 else [BorderingAreaRuleIndicator] end,
		[ReciprocalRuleIndicator] = case substring(@bitmap,3,1) & 2 when 2 then @c18 else [ReciprocalRuleIndicator] end,
		[DefaultRuleIndicator] = case substring(@bitmap,3,1) & 4 when 4 then @c19 else [DefaultRuleIndicator] end,
		[AdministrativeLevelTypeID] = case substring(@bitmap,3,1) & 8 when 8 then @c20 else [AdministrativeLevelTypeID] end,
		[CreatePermissionIndicator] = case substring(@bitmap,3,1) & 16 when 16 then @c21 else [CreatePermissionIndicator] end
	where [AccessRuleID] = @pkc1
if @@rowcount = 0
    if @@microsoftversion>0x07320000
		Begin
			if exists (Select * from sys.all_parameters where object_id = OBJECT_ID('sp_MSreplraiserror') and [name] = '@param3')
			Begin
				
				set @primarykey_text = @primarykey_text + '[AccessRuleID] = ' + convert(nvarchar(100),@pkc1,1)
				exec sp_MSreplraiserror @errorid=20598, @param1=N'[dbo].[AccessRule]', @param2=@primarykey_text, @param3=13233 
			End
			Else
				exec sp_MSreplraiserror @errorid=20598
		End
end  
else
begin 

update [dbo].[AccessRule] set
		[GrantingActorSiteGroupID] = case substring(@bitmap,1,1) & 2 when 2 then @c2 else [GrantingActorSiteGroupID] end,
		[GrantingActorSiteID] = case substring(@bitmap,1,1) & 4 when 4 then @c3 else [GrantingActorSiteID] end,
		[intRowStatus] = case substring(@bitmap,1,1) & 8 when 8 then @c4 else [intRowStatus] end,
