		[AuditCreateDTM] = case substring(@bitmap,1,1) & 32 when 32 then @c6 else [AuditCreateDTM] end,
		[AuditUpdateUser] = case substring(@bitmap,1,1) & 64 when 64 then @c7 else [AuditUpdateUser] end,
		[AuditUpdateDTM] = case substring(@bitmap,1,1) & 128 when 128 then @c8 else [AuditUpdateDTM] end,
		[rowguid] = case substring(@bitmap,2,1) & 1 when 1 then @c9 else [rowguid] end,
		[SourceSystemNameID] = case substring(@bitmap,2,1) & 2 when 2 then @c10 else [SourceSystemNameID] end,
		[SourceSystemKeyValue] = case substring(@bitmap,2,1) & 4 when 4 then @c11 else [SourceSystemKeyValue] end,
		[ReadPermissionIndicator] = case substring(@bitmap,2,1) & 8 when 8 then @c12 else [ReadPermissionIndicator] end,
		[AccessToPersonalDataPermissionIndicator] = case substring(@bitmap,2,1) & 16 when 16 then @c13 else [AccessToPersonalDataPermissionIndicator] end,
		[AccessToGenderAndAgeDataPermissionIndicator] = case substring(@bitmap,2,1) & 32 when 32 then @c14 else [AccessToGenderAndAgeDataPermissionIndicator] end,
